import React from 'react';
import '../css/Footer.css';

const Footer = ({ socialLinks }) => {
  return (
    <footer className="footer">
      <div className="footer__content">
        <div className="footer__logo">
          <img src="/ruta/del/logo.png" alt="Logo de la empresa" />
          <span>Empresa de Ciberseguridad</span>
        </div>
        <div className="footer__contact">
          <p>Contacto:</p>
          <p>Teléfono: (123) 456-7890</p>
          <p>Email: info@empresa-ciberseguridad.com</p>
          {/* Additional contact information can be added here */}
        </div>
      </div>
      <div className="footer__links">
        <ul>
          <li><a href="/politica-de-cookies">Política de Cookies</a></li>
          <li><a href="/politica-de-privacidad">Política de Privacidad</a></li>
          <li><a href="/proteccion-de-datos">Protección de Datos</a></li>
          <li><a href="/terminos-y-condiciones">Términos y Condiciones</a></li>
          {/* Additional links can be passed as props */}
        </ul>
      </div>
      <div className="footer__social">
        <p>Síguenos en redes sociales:</p>
        <div className="footer__social-icons">
          {socialLinks.map((link, index) => (
            <a
              key={index}
              href={link.url}
              target="_blank"
              rel="noopener noreferrer"
              aria-label={link.label}
            >
              <img src={link.icon} alt={link.label} />
            </a>
          ))}
        </div>
      </div>



    </footer>
  );
};

export default Footer;
